import { Header } from '../Components/Header';
import { Footer } from '../Components/Footer';
import '../style/main.css';
export function Home () {
    return (
        <div className="main-wrapper">
            <Header/>
            <br></br>
            <h1>Hello!
                <br></br>This is Utkarsh Singh,
                <br></br>I am an Aspiring<strong> Software Developer.</strong>
            </h1>
            <br></br>
            <p>Currently pursuing a <strong>Bachelor of Computer Applications (BCA),</strong> with a strong foundation in <strong>software development</strong>, <strong>data structures</strong>, <strong>operating systems</strong>, and <strong>database management</strong>. Proficient in Core Java, JSP, HTML, CSS, JavaScript, and frameworks like Spring MVC. Experienced in Oracle SQL for database-driven applications. Familiar with computer networking and system architecture. Passionate about problem-solving, web development, and writing efficient code. Constantly learning and working on real-world projects to enhance my technical skills. Open to opportunities in software development and IT.</p>
            <Footer/>
        </div>
    )
}
